					<div className="underline4"></div>
					<div className="carouselWrapper col-lg-12 col-md-10 col-sm-10 col-xs-10" >


										<div>
									        <h2>Pause On Hover</h2>
									        <Slider {...settings}>
									          <div>
									            <h3>1</h3>
